import { Link } from "react-router-dom";

//import css
import './into.css'

export const Into = () => {
   return(
            <div className = 'background_into'>
            <div className = 'div_into'>
                <div>
            <h1 className = 'title_into'>Henry Dogs</h1>
            <p className = 'p_into'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Perferendis sapiente nisi harum ipsa maiores doloremque quos repellat atque inventore libero magnam nulla nemo ex     labore, repudiandae optio quod alias consequatur!</p>
